import Headings from './Headings';
import { useState } from 'react';

function ChildContainer(props) {
  return (
    <>
      <Headings
        title={props.title}
        title2={props.title2}
      ></Headings>
      <div>{props.message}</div>
    </>
  );
}

export default ChildContainer;
